    function processImage(sourceImageUrl) {

        var FACEAzureObjectReturn = [
            //{ DataSetPicture: 5.1, OriginalAge: 3.5, OriginalGender: 1.4, PredictedAge: 0.2, PredictedGender: "Iris-setosa" }
        ];

        // Replace <Subscription Key> with your valid subscription key.
        var subscriptionKey = "101f1061e61cee4ec5b32f4c331575a4e9";

        // NOTE: You must use the same region in your REST call as you used to
        // obtain your subscription keys. For example, if you obtained your
        // subscription keys from westus, replace "westcentralus" in the URL
        // below with "westus".
        //
        // Free trial subscription keys are generated in the "westus" region.
        // If you use a free trial subscription key, you shouldn't need to change 
        // this region.
        var uriBase = "https://eastus.api.cognitive.microsoft.com/face/v1.0/detect";
        //"https://westcentralus.api.cognitive.microsoft.com/face/v1.0/detect";

        // Request parameters.
        var params = {
            "returnFaceId": "true",
            "returnFaceLandmarks": "false",
            "returnFaceAttributes":
                "age,gender,headPose,smile,facialHair,glasses,emotion," +
                "hair,makeup,occlusion,accessories,blur,exposure,noise"
        };

        // Perform the REST API call.
        $.ajax({
            url: uriBase + "?" + $.param(params),
            async: false,

            // Request headers.
            beforeSend: function (xhrObj) {
                xhrObj.setRequestHeader("Content-Type", "application/json");
                xhrObj.setRequestHeader("Ocp-Apim-Subscription-Key", subscriptionKey);
            },

            type: "POST",

            // Request body.
            data: '{"url": ' + '"' + sourceImageUrl + '"}',
        })

            .done(function (data) {
                // Show formatted JSON on webpage.
                console.log(JSON.stringify(data, null, 2));

                if (!$.isEmptyObject(data)) {
                    faceIdentifiedID = data[0].faceId;
                    var genderVal = data[0].faceAttributes.gender;
                    var ageVal = data[0].faceAttributes.age;

                    var happinessVal = data[0].faceAttributes.emotion.happiness;
;

                    var happinessValCalaculation = "No";

                    if (happinessVal >= 0.5) {
                        happinessValCalaculation = "Yes";
                    }

                    FACEAzureObjectReturn.push({
                        FaceID: faceIdentifiedID,
                        Gender: genderVal,
                        Age: ageVal,
                        Happiness: happinessValCalaculation
                    });
                }

                

            })

            .fail(function (jqXHR, textStatus, errorThrown) {
                // Display error message.
                var errorString = (errorThrown === "") ?
                    "Error. " : errorThrown + " (" + jqXHR.status + "): ";
                errorString += (jqXHR.responseText === "") ?
                    "" : (jQuery.parseJSON(jqXHR.responseText).message) ?
                        jQuery.parseJSON(jqXHR.responseText).message :
                        jQuery.parseJSON(jqXHR.responseText).error.message;
                alert(errorString);
            });

        return FACEAzureObjectReturn;
    }

